    <script>
      $(document).ready(function(){
         
         $("a[rel=popover]")
         .popover()              //popoverを適用
         .click(function(e) {    //規定のアクションをキャンセル→アンカータグの再描画を解除
           e.preventDefault()
         });

         $("polygon[rel=popover]")
         .popover({
            html: true,
            container: 'body',
        });

      });
      
      function get_id(shop){
          var shop_id = shop.getAttribute("id");
  
          var strForObjectiveC = new String();
          strForObjectiveC += 'webview://saveFunc?id=';
          strForObjectiveC += shop_id;
          
          window.location = strForObjectiveC;
      }
    
    function setcolor(code,shop_id){
        
        shop = document.getElementById('rect'+shop_id);
       
        switch (code) {
            case 'From':
            changecolorcode = '#00008b';
            break;
            case 'To':
            changecolorcode = '#dc143c';
            break;
//            default:
//            changecolorcode = '#660000';
//            break;
        }
        

        shop.setAttribute("fill", changecolorcode);
        
        return true;
    }

	</script>
